import React from 'react';
import './App.css';
import Jobs from "../src/Components/Jobs";

const mockJobs = [
  {
    title: 'SWE 1', company: 'Apple',
  },
  {
    title: 'SWE 2', company: 'Google',
  },
  {
    title: 'SWE 3', company: 'Facebook',
  }
]

onLoadHandler = () => {
  console.log('hohoho')
}

function App() {
  return (
    <div className="App">
      <Jobs onLoad={() => onLoadHandler} jobs={mockJobs} />
    </div>
  );
}

export default App;
